import React, { useState } from 'react';
// import Button from './Button';
import Counter from './Counter';

function ParentWrapper(){

    const [valeur, setValeur] = useState(0);
    function handleClick(){
        setValeur(valeur + 1);
    }
    return (
        <div>
        <button onClick={() => setValeur(valeur + 1)} className="button green">Ajouter</button>
        {/* <Button styleclass="green" label="Ajouter" onClick={() => setValeur(valeur + 1)}/> */}
        <Button styleclass="green" label="Ajouter" onClick={handleClick}/>
        <Counter valeur={valeur} />
        </div>
    );

}

export default ParentWrapper;
